const booksLoaded = (newBooks) => {
    return {
        type: 'BOOKS_LOADED',
        payload: newBooks
    }
}

const booksReuested = () => {
    return {
        type: 'BOOKS_REQUESTED'
    }
}

const booksError = () => {
    return {
        type: BOOKS_ERROR
    }
}

export {
    booksLoaded,
    booksReuested
    
}
